import React from 'react';
import {Codepen} from 'react-feather';
import {Container, Row, Col} from 'react-bootstrap';

function home() {
    return (
        <>
        <Container>
            <Row>
                <Col>
                    <Codepen className = "mx-auto" size = {200}></Codepen>
                </Col>
            </Row>
        </Container>   
        </>
    )
}

export default home
